import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';
import ReservationCalendar from './components/ReservationCalendar';
import TimeSlotSelector from './components/TimeSlotSelector';
import ReservationForm from './components/ReservationForm';
import SideMenu from './components/SideMenu';
import CourseSchedule from './components/admin/CourseSchedule';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>노바문화센터</h1>
          <Link to="/admin" className="admin-link">관리자 페이지</Link>
        </header>

        <Routes>
          <Route path="/admin" element={
            <div className="admin-layout">
              <SideMenu />
              <main className="admin-content">
                <Routes>
                  <Route path="courses" element={<CourseSchedule />} />
                  <Route path="reservations" element={<div>예약 관리 페이지</div>} />
                </Routes>
              </main>
            </div>
          } />

          <Route path="/" element={
            <main className="App-main">
              <div className="reservation-container">
                <ReservationCalendar onDateSelect={() => {}} />
                <TimeSlotSelector selectedDate={new Date()} onTimeSelect={() => {}} />
                <ReservationForm 
                  selectedDate={new Date()} 
                  selectedTime="09:00" 
                  onSubmit={() => {}}
                />
              </div>
            </main>
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
